// ProductList.js

import React from 'react';
import ProductCard from './ProductCard'; // Путь к вашему компоненту ProductCard

const ProductList = ({ products, addToCart }) => {
  return (
    <div className="product-list">
      {products.map((product) => (
        <ProductCard
          key={product.id} // Предполагается, что у товара есть уникальный идентификатор
          product={product}
          onAddToCart={addToCart}
        />
      ))}
    </div>
  );
};

export default ProductList;
